val test = portfolioData.filter(x => x.WeekOfYear == 50).filter(x => x.DayOfWeek == 4).collect
///val test3 = test2.filter( f => f.Year > 2006).collect
//test.toDF.registerTempTable("test")

val grpV = test.groupBy(_.sym)
//grpV.cache

val sym2Return = grpV.mapValues {
    symList =>

    val sorted = symList.toList.sortBy(_.Date.getTime)
    var perChangeYoY = List[Double]()

    var prev = sorted.head
    for (last <- sorted.tail) {
        perChangeYoY :+=  (math floor ((last.Close / prev.Close  ) -1) * 100) 
        prev = last
    }
    perChangeYoY
}

val sym2Mean = grpV.mapValues { sym=>
    val sorted = sym.toList.sortBy(_.Date.getTime)
    val closePrices = sorted.map(_.Close)  
    val mean = (closePrices.sum / closePrices.size)
    (math floor mean * 100) / 100  // just formatting not formula
}

val sym2StndDev = grpV.mapValues { sym =>

    val sorted = sym.toList.sortBy(_.Date.getTime)
    val closePrices = sorted.map(_.Close)  
    val mean = (closePrices.sum / closePrices.size)
    var tmp = 0.0
    for (c <- closePrices) {
        tmp += Math.pow((c-mean),2)
    }
    var variance = tmp / closePrices.size
    val value = Math.sqrt(variance)
    (math floor value * 100) / 100  // just formatting not formula
}

//sym2Return.cache
//sym2StndDev.cache
sym2Return.foreach(println)
sym2StndDev.foreach(println)

val sym2AvgDlyReturn = grpV.mapValues { 
    sym =>
    val sorted = sym.toList.sortBy(_.Date.getTime).toArray

    var prev = sorted.head
    var perChangeInPriceList = List[Double]()
    var variance = 0.0
    for (curr <- sorted.tail) {
       perChangeInPriceList :+= (curr.Close / prev.Close) -1
       prev = curr
    }
    val mean = perChangeInPriceList.sum / perChangeInPriceList.length

    for (dlyChange <- perChangeInPriceList) {   
        variance += Math.pow(( dlyChange - mean),2) 
    }
    val stndDev = Math.sqrt ((variance / sorted.length))
   (mean, stndDev)
}

case class SymbolStats (sym:String, meanPrice: Double, avgReturn: Double, stndDev:Double, ratio: Double, initialAmt:Double)

val symbolStatsList = grpV.map {
    case (symbol,v)=> 
    val meanPrice = sym2Mean.getOrElse(symbol,0.0)
    val stndDev = sym2StndDev.getOrElse(symbol,0.0)
    val avgReturn = sym2Return.get(symbol).get.sum/sym2Return.get(symbol).get.length
    val ratio = sym2PortfolioRatio.getOrElse(symbol,0.0)
    val initialAmt = investedAmountPerSymbol.getOrElse(symbol, 0.0)
    SymbolStats(symbol, meanPrice, avgReturn, stndDev, ratio, initialAmt)
}

sc.parallelize(symbolStatsList.toList).toDF.registerTempTable("stats")
sqlContext.cacheTable("stats")

