case class Simulation(symbol: String, interval: Int, simNum: Int, perChange: Double, ratio: Double, currentValue: Double)
import org.apache.commons.math3.distribution._
import scala.collection.mutable.Map
//val accum = sc.doubleAccumulator("My Accumulator")
//accum.add(totalAmountInvested)
var simsList = List[List[Simulation]]() 

List.range(0, sims).map { s =>

    val projections = sym2AvgDlyReturn.mapValues {
    case (mean, stndDev ) =>
    val nd = new NormalDistribution(mean, stndDev) 
    for (year <- 0 until futureYears)  
        yield  (year, nd.sample)
  }

val simulations = projections.map{  
    case (symbol, vec) =>
    val ratio =  sym2PortfolioRatio.getOrElse(symbol, 1.0)
    vec.map {
        case (year, perChange) => 
        Simulation(symbol, year, s, perChange, ratio, ((totalAmountInvested*ratio)*perChange))
    }
  }.flatten.toList

simsList :+= simulations
}

var totalPerSymbol:Map[String,Double] = scala.collection.mutable.Map()
var runningTotalPerSymbol:Map[String,Double] = scala.collection.mutable.Map()
investedAmountPerSymbol.map{ case(key, value) => totalPerSymbol += (key -> value)}
investedAmountPerSymbol.map{ case(key, value) => runningTotalPerSymbol += (key -> value)}

//simulations.foreach(println)

sc.parallelize(simsList)

case class PricedSimulation(symbol: String, interval: Int, simNum: Int, perChange: Double, currentValue: Double)
val pricedSimulations = sc.parallelize(simsList).flatMap{sim =>
                                    sim.map { x =>
                                    if(x.interval==0){
                                        totalPerSymbol.map{ case(key, value) => runningTotalPerSymbol += (key -> value)}
                                    }
                                    val currentValue = runningTotalPerSymbol.get(x.symbol).get
                                    val newValue = Math.abs((currentValue*x.perChange)) + currentValue
                                    runningTotalPerSymbol += (x.symbol -> newValue)
                                    PricedSimulation(x.symbol, x.interval, x.simNum, x.perChange, newValue)
                                }        
                            }

//pricedSimulations.collect.foreach(println)

val pricedSimulationDF = pricedSimulations.toDF
val sym2PortfolioRatioDF = sc.parallelize(sym2PortfolioRatio.toList).toDF
pricedSimulationDF.registerTempTable("PricedSimulation")
sqlContext.cacheTable("PricedSimulation")
sym2PortfolioRatioDF.registerTempTable("PortfolioBalance")
